        void fillGrid()
        {
            DataSet dsResult = SQLHelper.ExecuteDataset(conString, CommandType.Text, "SELECT a.APPLICATION_NO,a.MEDAProjectID,a.PROJECT_LOC,a.PROMOTOR_NAME,b.FileName,b.CreateBy, b.CreateDt FROM applicantdetails a, circletfs b WHERE a.APPLICATION_NO=b.APPLICATION_NO and a.APPLICATION_NO='" + Session["APPID"].ToString() + "'");
            if (dsResult.Tables.Count > 0)
            {
                if (dsResult.Tables[0].Rows.Count > 0)
                {
                    gvFiles.DataSource = dsResult.Tables[0];
                    gvFiles.DataBind();
                }
            }
        }
